const iosBack = 'data:image/png;base64,';

// wait design
const androidBack = 'data:image/png;base64,';

import './index.less';
import env from '@beibei/env';
const html2canvas = require('./html2canvas.min.js');

const random = (n, t) => {
    return null == t && (t = n, n = 0), n + Math.floor(Math.random() * (t - n + 1));
};

const toDouble = num => num.toString().length === 1 ? '0' + num : num;

const getTimeStr = () => {
    const oDate = new Date();
    const hour = oDate.getHours();

    return (hour < 12 ? '上午' : '下午') + (hour < 12 ? hour : (hour - 12)) + ':' + toDouble(oDate.getMinutes());
};

const isIOS = env.os.isIOS;

$('.J_btnConfirm').on('click', () => {
    const name = $('.J_inputName').val();
    const $resultArea = $('#J_resultArea');
    

    // 隐藏操作区
    $('.J_opZoom').hide();

    // 昵称
    $('.J_renderName').html(name ? name.trim() : '贝贝小伙伴');

    // ios 正常渲染，canvas生成没有锯齿
    if (isIOS) {
        // 待付款、待收货、待评价、购物车数量
        ['.J_renderToPay', '.J_renderToGet', '.J_renderAfter', '.J_renderCartNum'].forEach((selector, index) => {
            const num = random(index === 2 ? 1 : 30, index === 2 ? 10 : 99);
            $(selector).html(num).addClass('z-num-' + ('' + num).length);
        });

    // android 渲染正常，canvas生成的圆有锯齿
    } else {
        $('.J_renderToPay,.J_renderToGet,.J_renderAfter,.J_renderCartNum').remove();
    }

    $('.J_renderTime').html(getTimeStr());

    // 现金券
    $('.J_renderCoupon').html(random(20) + '张');
    // 余额
    $('.J_renderBalance').html('<em>¥</em>' + random(999) + '.' + random(99));

    $resultArea.css('backgroundImage', 'url(' + (isIOS ? iosBack : androidBack) + ')').show();

    html2canvas($resultArea[0], {
        onrendered: function(canvas) {
            let image = new Image();
            image.src = canvas.toDataURL('image/png');
            $('body').html(image);
        }
    });
});
